import React from 'react';
import logo from '../logo.svg';
import "bootstrap/dist/css/bootstrap.min.css";
import parth from "../images/parth.jpg";
import ReactTypingEffect from 'react-typing-effect';
// import './App.css';

const App = () => {

    useEffect(() => {
      const timer = setTimeout(() => {
        setCount('Timeout called!');
      }, 1000);
      return () => clearTimeout(timer);
    }, []);

    return (
      <div>
        Hello, World
      </div>
    );
  };

class Tag extends React.Component{

    render(){
        return (
            <div className="tag_bg">
                <div className="text-center tag_text"  style={{color : "white"}}>
                     {/* <img src={parth} className=" tag_img" /> */}
                    <App />
                     <h1 data-aos="fade-up">I am <ReactTypingEffect 
                     text={["Parth Patel","a Full Stack Developer",'an Android Developer','an IT guy','a student','an ICT engineer']} 
                     speed={100}
                     eraseDelay={200}
                     typingDelay={200}/> </h1>

                     {/* <h2>Developer</h2> */}

                </div>
            </div>
        )
    }
};

export default Tag;
